 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Se o seu obxectivo \u00e9 avaliar a comprensi\u00f3n dos conceptos de base ou a comprensi\u00f3n lectora <\/dt>  <dd>    <p>  Escriba un resumo do concepto ou lectura suficientemente extenso para que a s\u00faa lonxitude sexa adecuada para avaliar o co\u00f1ecemento que se quere comprobar, pero suficientemente curto para non inducir \u00e1 fatiga. Menos de unha p\u00e1xina \u00e9 probalemente adecuado, pero debe considerar menos para estudantes m\u00e1is pequenos ou principiantes.    <\/p>    <p>Selecione palabras no texto que sexan clave para comprender os conceptos. Estas ser\u00e1n probablemente verbos, sustantivos e adverbios clave. Elixa alternativas con unha resposta clara.    <\/p>  <\/dd>  <dt>Se a s\u00faa meta \u00e9 probar o co\u00f1ecemento de vocabulario<\/dt>  <dd><p>Escriba un texto no que utilice o vocabulario que quere avaliar. Este texto deber\u00eda ser coherente e ter unha unidade, e dunha lonxitude apropiada. Lea o par\u00e1grafo seguinte e escriba as palabras que faltan Escolla alternativas con unha resposta clara.<\/p>  <\/dd>  <dt>Si o seu obxectivo \u00e9 avaliar a morfolox\u00eda ou a gram\u00e1tica:  <\/dt>  <dd>  <p>Escriba o texto considerando estes obxectivos. Este texto deber\u00eda ser coherente e ter unha unidade, e dunha lonxitude apropiada. Recorde que o obxectivo non \u00e9 o co\u00f1ecemento do vocabulario, polo tanto os estudantes deben co\u00f1ecer xa o significado esencial das ra\u00edces dos termos utilizados.  <\/p>  <p>Resalte as palabras que quere avaliar no texto. Proporcione alternativas coa mesma ra\u00edz, pero con diferentes sufixos. \u00c9 unha boa idea conseguir que un colega comprobe os exercicios para asegurarse de que non haxa sorpresas!  <\/p>\n<p>ex..", 
