 "Reflection is a teaching method often used to \nconnect theory to practice. Reflection tasks often provide learners with an \nopportunity to observe and reflect on their observations before presenting \nthese as a piece of academic work. Journals, diaries, profiles and portfolios \nare useful tools for collecting observation data. Rubrics and guides can be \neffective feedback tools.": "A reflexi\u00f3n \u00e9 un m\u00e9todo de ensinanza de uso frecuente para conectar a teor\u00eda coa pr\u00e1ctica. As tarefas de reflexi\u00f3n proporcionan a mi\u00fado aos alumnos \nunha oportunidade para observar e reflexionar sobre as s\u00faas observaci\u00f3ns antes de presentalas \ncomo unha peza do traballo acad\u00e9mico. Os xornais, diarios, perf\u00eds e os cartafoles \nson ferramentas \u00fatiles para recoller os datos da observaci\u00f3n. As r\u00fabricas e gu\u00edas poden ser ferramentas de an\u00e1lise eficaces.", 
 "Use this pulldown to select whether or not  the iDevice should have any formatting  applied to it to distinguish it; ie. a border and an icon.": "Utilice este men\u00fa despregable para seleccionar se ao iDevice se lle debe aplicar alg\u00fan formato para distinguilo ou non, por exemplo un borde ou unha icona", 
 "Type in the feedback that you want the \nstudent to see when selecting the particular question. If you don't complete\nthis box, eXe will automatically provide default feedback as follows: \n\"Correct answer\" as indicated by the selection for the correct answer; or \n\"Wrong answer\" for the other alternatives.": "Escriba a retroalimentaci\u00f3n que quere que o alumno vexa cando seleccione unha opci\u00f3n en particular. Se non enche esta caixa de texto, eXe proporcionar\u00e1 automaticamente a retroalimentaci\u00f3n predeterminada como segue: \"Resposta correcta\" como indicada pola selecci\u00f3n da resposta correcta, ou \"Resposta errada\" para as outras opci\u00f3ns.", 
