 "<p>The reading activity, as the name \nsuggests, should ask the learner to perform some form of activity. This activity \nshould be directly related to the text the learner has been asked to read. \nFeedback to the activity where appropriate, can provide the learner with some \nreflective guidance.<\/p>": "<p>A actividade de lectura, como o seu nome indica, deber\u00eda suxerirlle ao alumno a realizaci\u00f3n dun tipo de actividade. Esta actividade deber\u00eda estar directamente relacionada co texto que se lle indicou como lectura. \n \nA retroacci\u00f3n na actividade, cando \u00e9 apropiada, p\u00f3delle proporcionar ao alumno unha \norientaci\u00f3n para a reflexi\u00f3n.<\/p>", 
 "Remove This Life": "Liminar elemento asociado", 
 "Flash Options": "Opci\u00f3ns Flash", 
 "JClic": "JClic", 
 "Objectives describe the expected outcomes of the learning and should\ndefine what the learners will be able to do when they have completed the\nlearning tasks.": "Os obxectivos describen os resultados que se espera que o alumno alcance e deber\u00edan\ndefinir o que ser\u00e1n capaces de facer os alumnos cando terminen as tarefas\nde aprendizaxe.", 
