 "Teachers should keep the following in mind when using this iDevice: <ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p>Os profesores deben recordar o seguinte cando utilicen este iDevice: <\/p><ol><li>Pense na cantidade de tipos diferentes de actividades planificadas como recurso que ser\u00e1n sinaladas visualme como contido. Trate de non utilizar moitos tipos diferentes de clasificaci\u00f3n de actividades, para que o estudante non se confunda. Normalmente tres ou catro tipos diferentes son m\u00e1is que suficientes para un recurso.<\/li><li>Dende unha perspectiva de dese\u00f1o visual, trate de non po\u00f1er os iDevices xuntos sen texto entre medias. Se considera que \u00e9 preciso, una d\u00faas preguntasa ou eventos nun iDevice. <\/li><li>Considere actividades nas que o beneficio de completar supere ao costo en tempo e esforzo ao de completala. <\/li><\/ol>", 
